def solution(stdin: str) -> str:
    from collections import deque
    n = int(stdin)
    steps = deque([(1, 1), (0, 1), (-1, 1), (0, -1)])
    seen = {0}
    while steps:
        x, y = steps.popleft()
        nx, ny = x + n, y + n
        for i, (dx, dy) in enumerate(steps):
            if not 0 <= nx + dx < 10001 and not 0 <= ny + dy < 10001:
                continue
            if nx + dx * 2 == n and ny + dy * 2 == n:
                return i + 1
            if (nx + dx, ny + dy) not in seen:
                steps.appendleft((nx + dx, ny + dy))
                seen.add((nx + dx, ny + dy))
    return 0

