def solution(stdin: str) -> str:
    '''
    The algorithm is pretty simple.
    We maintain a set of the heights that can be achieved by dropping the current figure.
    In every step, we drop the current figure to the leftmost column.
    If there is a way to drop the figure to some column that is not in the set,
    then we add all possible heights that can be achieved by dropping the figure there and then to the set.
    Otherwise, the figure can be dropped to any of the previously dropped columns.
    After the figure is dropped to every column, we update the set.
    In the end, we return the set size.
    '''
    def step(left_set, right_set, left_height, right_height):
        new_set = set()
        for col in left_set:
            for height in range(left_height + 1, right_height + 1):
                new_set.add(col + height)
        for col in right_set:
            for height in range(left_height + 1, right_height + 1):
                new_set.add(col - height)
        return new_set

    def drop(heights, left, right):
        if left > right:
            return set()
        if heights[left] == 0:
            return step(set(), set(heights), 0, right)
        return step(heights, set(heights), heights[left], right)

    total_heights = set(sum(heights) for heights in stdin.split('\n')[1:])
    return str(len([drop(heights, 0, len(heights) - 1) for heights in stdin.split('\n')[1:]]))

