class Character:
    def __init__(self, line: str):
        self.name, _, *line = line.split()
        self.languages_known = set(line)

    def add_language(self, language: str, character_set: set):
        if language in self.languages_known:
            return
        self.languages_known.add(language)
        for character in character_set:
            if language in character.languages_known:
                self.add_language(language, character_set)

    def can_leave(self, character_set: set):
        return len(self.languages_known - character_set) == 0

    def num_of_translations(self):
        return len(self.languages_known)


