    n = int(stdin[0])
    matrix = []
    for i in range(1, n + 1):
        matrix.append(list(stdin[i]))

    def get_neighbours(x, y):
        neighbours = []
        if x - 2 >= 1:
            neighbours.append((x - 2, y + 1))
        if x - 2 >= 1:
            neighbours.append((x - 2, y - 1))
        if x + 2 <= n:
            neighbours.append((x + 2, y + 1))
        if x + 2 <= n:
            neighbours.append((x + 2, y - 1))
        if y + 2 <= n:
            neighbours.append((x + 1, y + 2))
        if y + 2 <= n:
            neighbours.append((x - 1, y + 2))
        if y - 2 >= 1:
            neighbours.append((x + 1, y - 2))
        if y - 2 >= 1:
            neighbours.append((x - 1, y - 2))
        return neighbours

    def shortest_path(matrix, start_x, start_y, end_x, end_y):
        if end_x < 1 or end_x > n or end_y < 1 or end_y > n:
            return -1
        queue = deque([(start_x, start_y)])
        visited = set()
        visited.add((start_x, start_y))
        parent = {(start_x, start_y): (start_x, start_y)}
        while queue:
            x, y = queue.popleft()
            if (x, y) == (1, 1):
                break
            neighbours = get_neighbours(x, y)
            for neighbour in neighbours:
                if neighbour not in visited and matrix[neighbour[0] - 1][neighbour[1] - 1]!= "#":
                    queue.append(neighbour)
                    visited.add(neighbour)
                    parent[neighbour] = (x, y)
        if (1, 1) not in parent:
            return -1
        path = [(end_x, end_y)]
        while parent[(end_x, end_y)]!= (start_x, start_y):
            path.append(parent[(end_x, end_y)])
            end_x, end_y = parent[(end_x, end_y)]
        return len(path) - 1

    return shortest_path(matrix, 1, 1, n, n)

